import React from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import InputGroup from 'react-bootstrap/InputGroup';
import  '../components/styles/Footer.css';
import logoPicArg from '../logoPicArg.svg';

const NavigationBar= ()=>{
    return(
        <>
        <Navbar bg="light" expand="lg">

            <Navbar.Brand href="#home">

                <img src={logoPicArg}></img>
                
            </Navbar.Brand>

  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#link">Link</Nav.Link>

      <InputGroup>
    <FormControl className="ancho" placeholder="Buscar fotos, galerias y fotografos"
    />
    <InputGroup.Append>
      <Button variant="outline-secondary" className="buttonSearc">Buscar</Button>
    </InputGroup.Append>
  </InputGroup>
    </Nav>


  </Navbar.Collapse>
</Navbar>
</>
    )
}

export default NavigationBar;
